import React, { Component } from "react";
import './Menu.css'
import ShowContact from "./ShowContact";

export class Menu extends Component{
    
    render () {
        return (
          <main>
              {this.props.cont.map(el => (
                  <ShowContact onShowCont={this.props.onShowCont} key ={el.id} item={el}/>
              ))}
          </main>
        )
      }
}

export default Menu
